export default function TaskForm() {
    return (
        <div>
            <Label>Add taks Title</Label>
            <Input type="text" required placeholder="type here...."/>
            <Label>Add taks Content</Label>
            <Input type="text" required placeholder="type here...."/>
            <Button type="submit">Submit</Button>
        </div>
    )
}
